import React from 'react';
import {View} from 'react-native'

function Bottom(props) {
    return (
        <View style={{
            height: 80 ,
            backgroundColor:'white',
            flexDirection:'row'
        }}>
        <View style={{
            flex:3,
            backgroundColor:'red',
        }}>

        </View>
        
        
        </View>
        
    );
}

export default Bottom;
